class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $target
     * @return Integer
     */
    function minOperations($nums, $target) {
        $freq = array_fill(0, 31, 0);
        foreach ($nums as $num) {
            $freq[(int)log($num, 2)]++;
        }
        $operations = 0;
        for ($i = 30; $i >= 0; $i--) {
            if ($target >= (1 << $i)) {
                $needed = (int)($target / (1 << $i));
                $take = min($needed, $freq[$i]);
                $target -= $take * (1 << $i);
                $freq[$i] -= $take;
                $freq[$i - 1] += $take * 2;
                $operations += $take;
            }
        }
        return $target == 0 ? $operations : -1;
    }
}
